import React, { useEffect, useState } from 'react';
import Button from '@mui/material/Button';
import TextField from '@mui/material/TextField';

type Repo = {
  name: string;
  description: string | null;
  language: string | null;
  forks_count: number;
  stargazers_count: number;
  created_at: string;
  updated_at: string;
};

export default function Github() {
  const [username, setUsername] = useState<string>('');
  const [repos, setRepos] = useState<Repo[]>([]);

  useEffect(() => {
    const fetchUserData = async () => {
      try {
        const response = await fetch('https://api.github.com/users/EveWangUW/repos');
        if (!response.ok) {
          throw new Error('Failed to fetch data');
        }
        const data = await response.json();
        setUsername(data[0].owner.login); // assuming all repos belong to the same user
        setRepos(data);
      } catch (error) {
        console.error('Error fetching data:', error);
      }
    };

    fetchUserData();
  }, []);

  return (
    <div>
      <h1>GitHub Repositories for {username}</h1>
      <Button variant="contained">Contained</Button>
      <TextField id="outlined-basic" label="Outlined" variant="outlined" />
      <ul>
        {repos.map((repo) => (
          <li key={repo.name}>
            <h3>{repo.name}</h3>
            <p>Description: {repo.description || 'N/A'}</p>
            <p>Main Language: {repo.language || 'N/A'}</p>
            <p>Forks: {repo.forks_count}</p>
            <p>Stars: {repo.stargazers_count}</p>
            <p>Created At: {new Date(repo.created_at).toLocaleString()}</p>
            <p>Last Updated At: {new Date(repo.updated_at).toLocaleString()}</p>
          </li>
        ))}
      </ul>
    </div>
  );
};
